import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Score } from './Score'

function MusicVisualiser() {

  const [noteData, setData] = useState([]);

  useEffect(() => {
    // Make an API request to your Flask app
    axios.get('http://localhost:5000/get_note_data')
      .then((response) => {
        setData(response.noteData);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);
  return (
    <Score
      staves={[
       noteData
      ]}
    />
  )
}

export default MusicVisualiser;
